import React, { useState } from "react";
import { motion } from "framer-motion";

// Simple glass lightbox modal
function LightboxModal({ open, onClose, children }) {
    if (!open) return null;
    return (
        <div className="fixed inset-0 z-50 bg-black/40 flex items-center justify-center">
            <div className="glass-card rounded-2xl p-3 max-w-lg w-full shadow-2xl relative">
                <button
                    className="absolute top-3 right-4 text-2xl text-indigo-300 hover:text-indigo-500"
                    onClick={onClose}
                >Ã—</button>
                {children}
            </div>
        </div>
    );
}
// Parallax placeholder
function ParallaxDiagram() {
    return (
        <motion.div
            initial={{ y: 60, opacity: 0 }}
            whileInView={{ y: 0, opacity: 1 }}
            transition={{ duration: 0.8, type: "spring" }}
            className="mt-8 mb-14 flex justify-center items-center w-full h-44 bg-gradient-to-br from-blue-100 to-indigo-50 rounded-3xl shadow-lg border border-white/30"
        >
            <span className="text-indigo-500 font-bold text-xl">[Parallax System Diagram]</span>
        </motion.div>
    );
}

export default function EventManagementCaseStudy() {
    const [showDiagram, setShowDiagram] = useState(false);

    return (
        <div className="min-h-screen w-full flex flex-col items-center pb-24">
            <section className="w-full py-12 flex flex-col items-center bg-gradient-to-b from-blue-100 to-white">
                <h1 className="font-black text-4xl md:text-5xl text-indigo-700 text-center mb-3">Event Management & Ticketing System</h1>
                <p className="text-lg font-medium text-indigo-400 mt-4 max-w-2xl mx-auto mb-5 text-center">
                    Case study: scalable event platform, real-time ticket analytics & secure payments.
                </p>
                <div className="flex gap-6 mt-8 mb-6 justify-center">
                    <button
                        onClick={() => setShowDiagram(true)}
                        className="bg-indigo-500/70 hover:bg-indigo-600/90 text-white rounded-xl px-8 py-3 shadow-lg font-semibold backdrop-blur-md transition"
                    >Explore Architecture</button>
                </div>
                <div className="flex flex-wrap gap-4 justify-center">
                    {[
                        ["Stack", "React, Node, Express, MongoDB, Full Stack"],
                        ["Integration", "Payments, Social, Analytics"],
                        ["Scale", "10K+ events/month"],
                        ["PCI DSS", "Compliant"]
                    ].map(([title, text]) => (
                        <div key={title} className="glass-card px-5 py-2 rounded-2xl shadow backdrop-blur-md border border-white/30">
                            <span className="font-semibold text-indigo-600">{title}:</span> <span>{text}</span>
                        </div>
                    ))}
                </div>
            </section>
            <LightboxModal open={showDiagram} onClose={() => setShowDiagram(false)}>
                <ParallaxDiagram />
                <div className="mt-5 text-center text-indigo-700 font-semibold">Detailed system architecture diagram.</div>
            </LightboxModal>
            <section className="w-full max-w-3xl mt-14 px-3">
                {/* You can expand with Overview, Stakeholders, Problem, Architecture, Contribution sections as before */}
                <div className="glass-card px-6 py-6 rounded-3xl shadow backdrop-blur-md border border-white/30 mb-10">
                    <h2 className="text-xl font-bold text-indigo-700 mb-4">Project Goals</h2>
                    <ul className="list-disc ml-6 text-indigo-900 space-y-1 font-medium">
                        <li>Real-time seat selection and analytics</li>
                        <li>Dynamic pricing, mobile-first UX</li>
                        <li>Secure payments and attendance tracking</li>
                        <li>Organizer dashboard, post-event insights</li>
                        <li>Robust, scalable microservices architecture</li>
                    </ul>
                </div>
                <div className="glass-card px-6 py-6 rounded-3xl shadow backdrop-blur-md border border-white/30">
                    <h2 className="text-xl font-bold text-indigo-700 mb-4">My Contribution & Architecture Highlights</h2>
                    <ul className="space-y-2 text-indigo-900 font-medium">
                        <li><b>Role:</b> Architected microservices, built core API, payment & real-time modules.</li>
                        <li><b>Result:</b> 10,000+ concurrent users, sub-second ticket processing, 99.9% uptime.</li>
                        <li><b>Lesson:</b> Trade-offs in security vs. flexibility, contract-based API, serverless scaling.</li>
                    </ul>
                </div>
            </section>
        </div>
    );
}
